"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[686],{686:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"San Mateo County Pride Center","description":"The San Mateo County Pride Center is a collaboration model organization and one-stop shop for the LGBTQ+ community. We offer robust programs and services to support LGBTQ+ community members of all ages, including education, training, community events, peer support groups, daily programming, clinical therapy, and case management."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"A vibrant online community and hub of knowledge for individuals interested in do-it-yourself hormone replacement therapy (HRT). Their website is dedicated to providing a safe and inclusive space where people can access information, resources, and support for self-administered HRT. Whether you are exploring alternative methods, seeking guidance on dosage and administration, or simply looking to connect with others who share similar experiences, DIYHRT.cafe offers a wealth of valuable insights, personal stories, and expert advice to help you make informed decisions about your health and well-being."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"NSW Service for the Treatment and Rehabilitation of Torture and Trauma Survivors","description":"STARTTS is a specialist, not-for-profit organisation that provides culturally relevant psychological treatment, support, and community interventions to help people and communities heal from torture and refugee trauma and rebuild their lives in Australia. They also support LGBTQIA+ individuals from refugee and asylum seeker backgrounds."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"A comprehensive online platform dedicated to supporting individuals who are transitioning from female to male (FTM). Their website serves as a trusted resource, offering a wealth of information, guidance, and community connections for those embarking on their FTM journey. From practical advice on hormone therapy and surgical options to mental health support and personal stories, FTMGuide.org aims to empower individuals with the knowledge and resources they need to navigate their transition with confidence and clarity."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"A groundbreaking online platform dedicated to providing evidence-based research, education, and resources for the transgender and non-binary community, with a particular focus on feminizing hormone therapy (FHT). Their website serves as a vital hub for individuals seeking reliable and up-to-date information on the medical, physiological, and psychological aspects of FHT. Through their comprehensive collection of peer-reviewed studies, expert articles, and practical guides, their site empowers individuals to make informed decisions about their transition and health."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"A trusted online resource for individuals seeking knowledge, support, and understanding about gender dysphoria. Their website provides a wealth of information, resources, and community connections to empower individuals on their journey. From comprehensive guides on gender identity and transitioning to personal stories and expert advice, they strive to create a safe and inclusive space for all."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Movement Advancement Project","description":"The Movement Advancement Project (MAP) is an independent, nonprofit think tank that provides rigorous research, insight, and communications that help speed equality and opportunity for all. MAP works to ensure that all people have a fair chance to pursue health and happiness, earn a living, take care of the ones they love, be safe in their communities, and participate in civic life."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Jordan Ross Communication Services","description":"Jordan Ross provides speech, voice and communication coaching for trans, queer and gender non-conforming individuals. He offers 1-On-1 coaching, online courses, events, and the \'Voice Within Coaching Program\'. His approach incorporates neuro-linguistic programming, hypnotherapy, yoga instruction, and breath coaching, aiming to address not just physical but also mental, emotional, and energetic aspects of communication."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Gender Dynamix Online Education Portal","description":"Gender Dynamix is an Africa-based non-profit organization that aims to promote, advance, and protect the human rights of trans and gender diverse communities in South Africa and across southern Africa. The organization conducts advocacy, facilitates capacity building, and provides direct services to the community. They also offer online resources related to healthcare, educational programs, and legal gender recognition."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Sylvia Rivera Law Project (SRLP)","description":"The Sylvia Rivera Law Project works to guarantee that all people are free to self-determine gender identity and expression, regardless of income or race, and without facing harassment, discrimination or violence. SRLP provides legal help, organizes campaigns, conducts trainings, and runs a Prisoner Advisory Committee. Community involvement is encouraged through donations, volunteering, and membership."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Erin In The Morning","description":"News and discussion on trans legislation and life. By Erin Reed · Over 38,000 subscribers"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"An innovative online platform that aims to create a comprehensive and up-to-date resource for global LGBTQ+ rights. Their website provides a centralized database of laws, policies, and societal attitudes towards LGBTQ+ rights from around the world. By mapping and visualizing data on equality, inclusivity, and legal protections, EqualDex.com offers a powerful tool for activists, researchers, and individuals seeking to understand and advocate for LGBTQ+ rights on a global scale. Explore their interactive maps, browse country-specific profiles, and stay informed about the latest advancements and challenges facing the LGBTQ+ community worldwide."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans is a global network of hair, beauty, and wellness industries and organizations that seek to create and inspire safe and positive experiences for all guests, especially guests from the trans community."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Pacific Center for Human Growth","description":"Founded in 1973, Pacific Center for Human Growth is the oldest LGBTQIA+ center in the Bay Area, the third oldest in the nation, and operates the only sliding scale mental health clinic for LGBTQIA+ and QTBIPOC people and their families in Alameda County."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Oakland LGBTQ Community Center","description":"Oakland\'s first ever Non-profit 501c3, all ages, all inclusive LGBTQ community service center. Services offered include support groups, mental health support, housing assistance, youth program, legal clinic, food pantry etc. Special programs are also conducted for aged LGBTQ+ people and transgender community members."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Gender Diversity","description":"Gender Diversity improves the well-being of children and adults of all gender identities and expression by providing education, increasing awareness, and offering insight into the wider range of human experience. We also assist in creating supportive and non-discriminatory environments in schools, sports teams, workplaces, and healthcare providers for transgender and gender diverse individuals."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"National Center for Transgender Equality","description":"The National Center for Transgender Equality is an organization advocating to change policies and societal attitudes for increased understanding and acceptance of transgender people. The NCTE provides information about issues affecting the Transgender community including aging, anti-violence, employment, families, health & HIV, housing & homelessness, and more."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"The Inner Circle","description":"A Global Muslim community aimed to bring healing to Muslims who are marginalised based on sexual orientation and gender identity through spirituality, education, and movement building"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Florida Name Change Home","description":"This website provides a step-by-step guidance for those who want to update their name or gender in Florida. The steps include filing a petition in court, and updating Social Security card, driver license, passport, and birth certificate."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project is an American non-profit organization providing suicide prevention services to LGBTQ+ youth. The site provides valuable resources for the transgender community, including crisis intervention and suicide prevention lifeline, TrevorChat, and TrevorText as well as guidance on mental health, social services, and support groups."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"A Place for Marsha","description":"A Place for Marsha is one of many start-up projects aiming towards helping Trans individuals and families in increasingly dangerous states to a safer place. APFM began its journey in March of 2023 in reaction to the rise of anti-trans legislation around the nation. APFM now focuses on matching Refugees from red states as roommates, carefully handling one household at a time."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"GOOD HOPE Metropolitan Community Church","description":"A theologically progressive and inclusive Christian community founded on the principles of Jesus Christ that celebrates diversity and provides a safe, non-judgmental space where all are welcome. Part of an inclusive Christian congregation based in Cape Town, South Africa and part of the larger international denomination known as Metropolitan Community Churches (MCC)."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons offers quality voice control and liberation services for transgender and non-binary individuals aiming to sound more masculine, feminine, or androgynous."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"The Gender Centre Inc.","description":"The Gender Centre Inc. is providing a broad range of specialised services that enables the exploration of gender identity and assistance with the alleviation of gender dysphoria. It supports trans and gender expressive people at every stage of their journey as they explore and live their authentic sense of self. It offers accommodation, case management, education & training, counseling & mental health services, groups, news, and resources."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"A vital online platform dedicated to assisting and advocating for LGBTQ+ individuals who are facing persecution and violence worldwide. With unwavering commitment, the website connects those in immediate danger to life-saving resources, emergency assistance, and secure pathways to safety. Through partnerships with local organizations and a network of compassionate supporters, RainbowRailroad.org works tirelessly to provide advocacy, legal aid, and relocation support, enabling individuals to escape persecution and find refuge. By championing human rights, saving lives, and fostering a more inclusive world, RainbowRailroad.org serves as a beacon of hope and protection for LGBTQ+ individuals seeking safety and freedom."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"The McKenzie Project","description":"A comprehensive resource offering services, programs and events aimed at promoting gender justice and serving the transgender community. Includes support services and resources including healthcare, legal assistance, mental health services and more."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"East Bay Trans & Queer Counseling","description":"East Bay Trans & Queer Counseling offers sliding scale services that include: Individual Therapy centrally located in Berkeley, CA Support through gender exploration and transition Recommendation letters for hormones and surgery Professional trainings for mental health providers, students, and employers. Sam Davis is a transgender, genderqueer Licensed Clinical Social Worker (LCSW) specializing in working with trans, queer, genderqueer, and gender-nonconforming teens and adults. They have 16 years of experience as a mental health provider in the East Bay, including peer support group facilitation, community education at LGBTQI conferences, and 9 years of clinical practice and crisis counseling with severely marginalized people for the County of Alameda. They are a strong and committed advocate with a long history of organizing on behalf of marginalized people."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub is a digital information and resource platform for all trans and gender diverse people in NSW, their loved ones, allies and health providers. It provides access to much needed information and resources for a community that may not have had access to such as they grew up or grew towards their authentic selves. Information ranges from medical needs such as hormones, surgeries and doctor lists to social and legal issues."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"Twenty10 including GLCS provides various life-changing services to young people across NSW who identify as lesbian, gay, bisexual, transgender or gender diverse, intersex, queer, asexual or are questioning their identity. Their services include intake and referral, housing and case management, counseling, social support programs, and LGBTIQA+ inclusivity training"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Transgender Map","description":"Transgendermap.com is an online resource aimed at providing practical information and guidance to people who are questioning their gender identity or are somewhere on the transgender spectrum. The website includes a wide range of topics like understanding transgender terminology, transition processes, legal issues, healthcare, and numerous personal stories. Its goal is to help individuals navigate their personal journeys by providing a \'map\' or guide to the many aspects of gender identity and transgender experiences. Please visit the actual site for the most current and accurate information."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Trans Families","description":"Trans Families inspires hope, increases understanding, and creates a visible pathway to support trans and gender diverse children and all those who touch their lives. We provide resources, organize events, and connect families to support groups."}]')}}]);